import React,{useEffect} from 'react'
import jwtDecode from "jwt-decode"

function Home() {
    useEffect(()=> {
        if (localStorage.Authentication) {
            if (jwtDecode(localStorage.Authentication).exp > Date.now()) {
                window.location.href = "/login"
            }
        } else {
            window.location.href = "/login"
        }
    })

    return (
        <div>
            <h1>Hello</h1>
        </div>
    )
}

export default Home
